                console.log(res.data);
            });

        //     const data = await response.json();
        //     console.log(data);
        //document.getElementById('Playlists').textContent = Playlist;
    };

    const getRecents = () => {
        axios
            .get(config.api.url + "/streams/recent", {
                headers: {
                    Authorization:
                        "eyJhbGciOiJIUzI1NiIsInR5cCI6IkpXVCJ9.eyJlbWFpbF9pZCI6ImhyaXRoaWtnYXZhbmthcjg1ODJAZ21haWwuY29tIiwiaWF0IjoxNjM4NjQ5ODQwLCJleHAiOjE2Mzg2NTM0NDB9.93E_7dVPvjiHRd9wBqNFN4AQ6wu9g3v1375_vTN9VZ0",
                },
            })
            .then((res) => {
                console.log(res.data);
            });
    };

    useEffect(() => {
        if (streamUrl) window.location.href = streamUrl;
    }, [streamUrl]);

    return (
        <div className="stream-page">
            <Container>
                <Row>
                    <Col>
                        <Card style={{ width: "18rem" }}>
                            <Card.Img variant="top" src="holder.js/100px180" />
